if(document.querySelector(".buttonTabs")){let t=document.querySelectorAll(".buttonTabs button"),e=document.querySelectorAll(".contentTabs section");for(let s=0;s<t.length;s++)t[s].addEventListener("click",()=>{t.forEach(t=>t.classList.remove("active")),t[s].classList.add("active"),e[s].classList.contains("activeTabs")||(e.forEach(t=>{t.classList.remove("activeTabs")}),e[s].classList.add("activeTabs"))})}